script: |
  super -f text -I q2641.spq | sort > q2641.out

inputs:
  - name: q2641.spq
    data: |
      SELECT DISTINCT + col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 39 IN ( + 24 - + col2 + + - 15, - 8, 55 * - + 37, col2 );
  - name: tab1

outputs:
  - name: q2641.out
    data: |
      14
      47
      5
